import React, { Component } from "react";

import { connect } from "react-redux";
import "./HomeHeader.scss";
import { FormattedMessage } from "react-intl";
import { LANGUAGES } from "../../utils/constant";
import { changeLanguageApp } from "../../store/actions";
import { withRouter } from "react-router";
import logovn from "../../assets/images/logovn.png";
import logoen from "../../assets/images/logoen.png";
class HomeHeader extends Component {
  ChangeLanguages = (language) => {
    this.props.changeLanguageAppRedux(language);
  };

  render() {
    let language = this.props.language;

    return (
      <>
        <div className="home-header-container">
          <div className="home-header-content">
            <div className="left-content">
              <i className="fas fa-bars"></i>

              <div className="header-logo">
                <a href="/home" className="header-logo-link">
                  <span>Booking</span>
                  <span>Doctor.com</span>
                </a>
              </div>
            </div>
            <div className="center-content">
              <div className="child-content">
                <div>
                  <b>
                    <FormattedMessage id="home-header.Speciality" />
                  </b>
                </div>
                <div className="subs-title">
                  <FormattedMessage id="home-header.Search-doctor" />
                </div>
              </div>
              <div className="child-content">
                <div>
                  <b>
                    <FormattedMessage id="home-header.Health-facility" />
                  </b>
                </div>
                <div className="subs-title">
                  <FormattedMessage id="home-header.Select-room" />
                </div>
              </div>
              <div className="child-content">
                <div>
                  <b>
                    <FormattedMessage id="home-header.Doctor" />
                  </b>
                </div>
                <div className="subs-title">
                  <FormattedMessage id="home-header.Select-doctor" />
                </div>
              </div>
              <div className="child-content">
                <div>
                  <b>
                    {" "}
                    <FormattedMessage id="home-header.Fee" />
                  </b>
                </div>
                <div className="subs-title">
                  <FormattedMessage id="home-header.Check-health" />
                </div>
              </div>
            </div>
            <div className="right-content">
              <div className="support">
                <i className="fa fa-question-circle"></i>
                <FormattedMessage id="home-header.Sp" />
              </div>
              <div
                className={
                  language === LANGUAGES.VI
                    ? "language-vi active"
                    : "language-vi"
                }
              >
                <span
                  onClick={() => {
                    this.ChangeLanguages(LANGUAGES.VI);
                  }}
                >
                  {language === LANGUAGES.VI ? (
                    <img
                      src={logovn}
                      className="logovn"
                      style={{
                        width: "50px",
                        height: "30px",
                        margin: "10px",
                        borderRadius: "5px",
                      }}
                    />
                  ) : (
                    <></>
                  )}
                  VN
                </span>
              </div>
              <div
                className={
                  language === LANGUAGES.EN
                    ? "language-en active"
                    : "language-en"
                }
              >
                <span
                  onClick={() => {
                    this.ChangeLanguages(LANGUAGES.EN);
                  }}
                >
                  {language === LANGUAGES.EN ? (
                    <img
                      src={logoen}
                      className="logoen"
